css:
@-moz-document domain("finobe.sex") {
body {
    background-color: #f5f5f5;
}
.navbar-brand img {
    content: url("http://web.archive.org/web/20161109005516im_/https://xdiscuss.net/html/img/logo.png");
}
.navbar-brand {
    color: transparent!important;
    width: 190px;
}
.navbar-light.bg-faded.navbar-light-halloween {
    background: #fff!important;
    box-shadow: 0 1px 2px rgba(0,0,0,0.3)!important;
    color: #666666;
    margin-bottom: 10px;
}
.navbar-light .navbar-nav .nav-link {
    color: #666666;
    transition: all 0.2s;
}
.navbar-light .navbar-nav .nav-link:hover {
    color: #212121;
}
.nav-scroller {
    display: none;
}
.footer {
    bottom: 0;
    width: 100%;
    text-align: center!important;
    background-color: #ffffff;
    height: 100px;
}
.footer>.container {
    border: none;
    background: transparent;
}
.align-items-center {
    display: none!important;
}
.btn {
    text-transform: uppercase;
    border: none;
    box-shadow: 1px 1px 4px rgba(0,0,0,0.4);
    transition: all 0.4s;
    position: relative;
}
.btn-success:hover, .btn-success:active:hover {
    background-color: #439a46;
}
.card-header, .bg-primary {
    background-color: rgba(255,255,255,.84)!important;
    border-radius: 0px!important;
    color: #212529!important;
}
.card-body {
    background-color: #eeeeee;
}
.card {
    background-color: transparent;
    border: none;
    border-radius: 0px;
}
}

@-moz-document url("https://finobe.sex/") {
.navbar-light.bg-faded.navbar-light-halloween {
    margin-bottom: 0px;
    background: #292525!important;
}
.home-main-content {
    background: url(https://i.imgur.com/WpJl2dM.png) no-repeat center center;
    box-shadow: 0 1px 2px rgba(0,0,0,0.3)!important;
}
.navbar-light .navbar-nav .nav-link, h3 {
    color: white;
}
.navbar-light .navbar-nav .nav-link:hover {
    color: white;
}
.mb-4, .my-4 {
    text-shadow: 0px 2px 4px #a0a0a0;
}
body, .card-body {
    background: #151313!important;
}
.footer, .game-card {
    color: white;
    background: #292525!important;
}
}

@-moz-document url-prefix("https://finobe.sex/catalog") {
.card-body {
    background-color: white;
}
}
